bio:
- Nerdy curious product manager with 6+ years of experience dedicated to delivering value aligned with stakeholders' interests and ensuring customer satisfaction;
- Experienced in leading teams through development processes, from inception to raising funds with roadmap to product launch, while maintaining focus on growth and strategic objectives;
- Committed to continuous learning and development, with a focus on advancing skills in growth-oriented product management roles;
- Proven track record of launching and optimizing products in investments and global banking(fintech); QSR and delivery; branding within startups and big brands;
- Skilled in navigating regulatory complexities, mitigating risks, and implementing data-driven strategies to improve product performance and achieve market success;
